import React, { useState, useEffect } from "react";
// import Newslist from "./newslist";

export default async function Main() {
  // const [news, setNews] = useState([]);
  // const [pageno, setPageno] = useState(1);

  const url = 'https://newsnow.p.rapidapi.com/newsv2';
  const options = {
    method: 'POST',
    headers: {
      'content-type': 'application/json',
      'X-RapidAPI-Key': '43e4c5b983msh43ef0f0b889a10cp12c248jsnf756ee60e589',
      'X-RapidAPI-Host': 'newsnow.p.rapidapi.com'
    },
    body: {
      query: 'AI',
      page: 1,
      time_bounded: true,
      from_date: '01/02/2021',
      to_date: '05/06/2021',
      location: '',
      category: '',
      source: ''
    }
  };
  
  try {
    const response = await fetch(url, options);
    const result = await response.text();
    console.log(result);
  } catch (error) {
    console.error(error);
  }

  return (
    <div
      className="container h-100 w-100"
      style={{ minHeight: "100vh", minWidth: "95vw", margin: "0 auto" }}
    >
      <h1 className="text-center my-2">News app</h1>
      
      <div
        className="my-3"
        style={{
          maxWidth: "80vw",
          display: "flex",
          justifyContent: "space-between",
        }}
      >
        <button className="btn btn-secondary">previous&larr;</button>
        <button className="btn btn-primary">next&rarr;</button>
      </div>
    </div>
  );
}
